// Begin part1.s for Lab 7
void clear_screen();
void draw_line(int x0, int x1, int y0, int y1, short int line_color);
void plot_pixel(int x, int y, short int line_color);
void draw_poly(int num_vertices, int *vertices, short int color);
void draw_player_pos1(int x, int y);
void clear_player_pos1(int x, int y);
short int convert_to_32_bits(int color);

volatile int pixel_buffer_start; // global variable

int main(void){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;

    clear_screen();

    draw_line(0, 200, 319, 200, RED);// line of base platform
    for(int x = 0; x < 320; x++){
      for(int y = 200; y < 240; y++){
        plot_pixel(x, y, RED);
      }
    }
    int num_vertices = 3;
    int vertices[6] = {100, 150, 150, 190, 200, 100};
    draw_poly(num_vertices, vertices, MAGENTA);
    draw_player_pos1(0, 0);
}

void clear_screen(){
  for(int x = 0; x < 320; x++){
    for(int y = 0; y < 240; y++){
      plot_pixel(x, y, 0xFFFF);
    }
  }
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color){
  bool is_steep = ABS(y1 - y0) > ABS(x1 - x0);
  int temp = 0;
  int y_step = 0;
  if (is_steep){
    //swap x0 and y0
    temp = x0;
    x0 = y0;
    y0 = temp;
    //swap x1 and y1
    temp = x1;
    x1 = y1;
    y1 = temp;
  }
  if(x0 > x1){
    //swap x0 and x1
    temp = x0;
    x0 = x1;
    x1 = temp;
    //swap y0 and y1
    temp = y0;
    y0 = y1;
    y1 = temp;
  }

  int deltax = x1 - x0;
  int deltay = ABS(y1 - y0);
  int error = -(deltax / 2);
  int y = y0;

  if (y0 < y1){
    y_step = 1;
  }
  else{
    y_step = -1;
  }

  for(int x = x0; x < x1; x++){
    if (is_steep){
      plot_pixel(y, x, line_color);
    }
    else{
      plot_pixel(x, y, line_color);
    }

    error = error + deltay;
    if (error > 0){
      y = y + y_step;
      error = error - deltax;
    }
  }
}

void draw_poly(int num_vertices, int *vertices, short int color){
  for(int i=0;i<num_vertices-1;i++)
    {
      draw_line(vertices[(i<<1)+0],
           vertices[(i<<1)+1],
           vertices[(i<<1)+2],
           vertices[(i<<1)+3],
           color);
    }
    draw_line(vertices[0],
         vertices[1],
         vertices[(num_vertices<<1)-2],
         vertices[(num_vertices<<1)-1],
         color);
}

void plot_pixel(int x, int y, short int line_color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

